import React from 'react'
import Tarjeta from './tarjeta'

import foto1 from '../assets/1.jpg'
import foto2 from '../assets/2.jpg'
import foto3 from '../assets/3.jpg'
import foto4 from '../assets/4.jpg'

const tarjs = [
    {
        id: 1,
        titulo: 'Restaurantes',
        imagen: foto1
    },
    {
        id: 2,
        titulo: 'Afiliarse',
        imagen: foto2
    },
    {
        id: 3,
        titulo: 'Registrarse',
        imagen: foto3
    },
    {
        id: 4,
        titulo: 'Ingresar',
        imagen: foto4
    },
]

function tarjetas() {
    console.log(tarjs)
    return (
        <div className="container d-flex justify-content-center align-items-center h-100">
            <div className="row">
                {
                    tarjs.map(tarjeta => (
                        <div className="col-md-4" key={tarjeta.id}>
                        <Tarjeta titulo={tarjeta.titulo}/>
                </div>
                    ))
                }
                
               
                
            </div>
                
        </div>
    )
}

export default tarjetas
